import React from "react";
import {add,sub,mult,div} from "./Calc";

function Indexchallege5(){
    return( <>    
   <ul>
    <li>sum of two number is {add(5,7)}</li>
     <li>sub of two number is {sub(8,4)}</li>
     <li>div of two number is {div(35,5)}</li>
     <li>mult of two number is {mult(5,6)}</li>
   </ul>
    </>)
   
}
export default Indexchallege5;
